import React from "react";
import ProductCard from "./ProductCard";
import "./ProductGrid.css";

const StoreSearchGrid = ({ products = [], onStoreProductClick }) => {
  console.log('-store search products--', products);
  return (
    <div><div className={`store-grid-title`}></div>
      <>{products.map((product, index) => (
        <div className="product-card store-product-card" onClick={(e)=>{onStoreProductClick()}}>
            <img
              src={product.image_url}
              alt={product.title}
              style={{ height: '150px' }}
            />
          </div>
      ))}
      </>
    </div>
  );
};

export {StoreSearchGrid};
